import React from "react";
import "../defaults.css";
import "./SectionContainer.css";

const SectionContainer = props => {
  return (
    <section className={props.theme + "-sect"}>
            <div className="rect-grid">
      {props.children}
            </div>
    </section>
  );
};

export default SectionContainer;
